import React from "react";
import '../App.css'
import { HomeNavBar } from "../Layouts/HomeNavBar";
import CardComponent from "../Layouts/CardComponent";
import { Cards } from "../Ui/Cards";

export function Store() {
    return (
        <div>
            <div className='home_header'>
                <div><HomeNavBar/></div>
            </div>
            <CardComponent/>
            <div>
                <div className="">
                    <Cards/>
                </div>
            </div>
        </div>
    )
}
